import React from 'react';
import { useNavigate } from 'react-router-dom';

const features = [
  '300 Local Geotagged Map Points',
  '15-45 mile radius coverage',
  '20 driving direction paths',
  '10 Geotagged images',
  'NAP embedded stacking',
  '99 High DA backlinks',
  '30-Day Drip Feed',
  'Full Indexing Verification'
];

export default function MapPowerBoost() {
  const navigate = useNavigate();
  return (
    <section className="min-h-screen bg-primary-950 text-white py-16 px-4 flex flex-col items-center justify-center">
      <div className="max-w-2xl w-full bg-primary-900 rounded-3xl shadow-2xl p-8 md:p-12">
        <h1 className="text-4xl md:text-5xl font-bold mb-4 text-electric-blue">Map PowerBoost</h1>
        <p className="text-lg text-gray-200 mb-6">A one-time Google Maps optimization boost to skyrocket your local rankings. Perfect for businesses wanting a fast, safe, and effective local SEO jumpstart.</p>
        <h2 className="text-2xl font-semibold mb-2 text-orange-400">What’s Included:</h2>
        <ul className="mb-6 space-y-2">
          {features.map((f, i) => (
            <li key={i} className="flex items-center gap-2">
              <span className="inline-block w-2 h-2 bg-electric-blue rounded-full"></span>
              <span>{f}</span>
            </li>
          ))}
        </ul>
        <h2 className="text-xl font-semibold mb-2 text-orange-400">Why Choose Map PowerBoost?</h2>
        <ul className="mb-6 space-y-2 text-gray-200">
          <li>• Rapid local ranking improvements</li>
          <li>• 100% safe, white-hat, and Google-compliant</li>
          <li>• Full reporting and indexing verification</li>
        </ul>
        <button onClick={() => navigate(-1)} className="mt-6 px-6 py-3 rounded-xl bg-electric-blue text-primary-950 font-bold hover:bg-orange-400 transition">Back to Packages</button>
      </div>
    </section>
  );
}
